import React from 'react';
import './App.css';

const galleryImages = [
  { src: 'https://images.unsplash.com/photo-1464983953574-0892a716854b?auto=format&fit=crop&w=400&q=80', alt: 'Crowded Club Event' },
  { src: 'https://images.unsplash.com/photo-1506744038136-46273834b3fb?auto=format&fit=crop&w=400&q=80', alt: 'DJ on Stage' },
  { src: 'https://images.unsplash.com/photo-1515168833906-d2a3b82b2c91?auto=format&fit=crop&w=400&q=80', alt: 'Dancing Crowd' },
  { src: 'https://images.unsplash.com/photo-1465101046530-73398c7f28ca?auto=format&fit=crop&w=400&q=80', alt: 'Club Lights' },
  { src: 'https://images.unsplash.com/photo-1519125323398-675f0ddb6308?auto=format&fit=crop&w=400&q=80', alt: 'Party People' },
];

function Gallery() {
  return (
    <section className="gallery-section">
      <h2>Gallery</h2>
      <div className="gallery-grid">
        {galleryImages.map((img, idx) => (
          <div key={idx} className="gallery-img-wrap">
            <img src={img.src} alt={img.alt} className="gallery-img" />
          </div>
        ))}
      </div>
    </section>
  );
}

export default Gallery;
